import React from "react";
import "./Chart.css";
import Chartbar from "./ChartBar";

const Chart = (props) => {
  const dataPointValue = props.dataPoint.map((datapoint) => datapoint.value);
  const totalMamimum = Math.max(...dataPointValue);
  return (
    <div className="chart">
      {props.dataPoint.map((dataPoint) => (
        <Chartbar
          key={props.dataPoint.label}
          value={propsdataPoint.value}
          maxValue={totalMamimum}
          label={props.dataPoint.label}
        />
      ))}
    </div>
  );
};

export default Chart;
